// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import '@openzeppelin/contracts-upgradeable/proxy/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol'; //TODO: chage
import '@openzeppelin/contracts/math/SafeMath.sol';
import './interfaces/ICipherCore.sol';
import './interfaces/IAaveLendingPool.sol';
import './interfaces/IAaveLendingPoolAddressesProvider.sol';
import './interfaces/IAaveIncentivesController.sol';
import './interfaces/IUniswapRouterV2.sol';

contract CipherCore is Initializable, AccessControlUpgradeable, ICipherCore {
    using SafeMath for uint256;

    IAaveLendingPoolAddressesProvider public aaveLendingPoolAddressesProvider;
    IERC20 public aaveAToken;
    IERC20 public underlyingToken;
    IERC20 public tagToken;
    IUniswapRouterV2 public swapRouter;
    uint256 public principalBalance;
    IAaveIncentivesController public aaveIncentivesController;
    uint256 public minAmountToClaim;

    bytes32 public constant GAME_ADMIN = keccak256('GAME_ADMIN');

    event Deposit(address from, uint256 amount);
    event YieldHarvested(uint256 usdYieldAmount, uint256 tagsAmount);

    function initialize(
        IAaveLendingPoolAddressesProvider _aaveLendingPoolAddressesProvider,
        IERC20 _aaveAToken,
        IERC20 _underlyingToken,
        IERC20 _tagToken,
        IUniswapRouterV2 _swapRouter,
        IAaveIncentivesController _aaveIncentivesController,
        uint256 _minAmountToClaim
    ) public initializer {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());

        aaveLendingPoolAddressesProvider = _aaveLendingPoolAddressesProvider;
        aaveAToken = _aaveAToken;
        underlyingToken = _underlyingToken;
        tagToken = _tagToken;
        swapRouter = _swapRouter;
        aaveIncentivesController = _aaveIncentivesController;
        minAmountToClaim = _minAmountToClaim;
    }

    function totalBalance() view external returns (uint256) {
        return aaveAToken.balanceOf(address(this));
    }

    function deposit(uint256 amount) external override {
        require( //TODO: add safe transfer
            underlyingToken.transferFrom(_msgSender(), address(this), amount),
            'Unable to pull funds from the sender'
        );

        _deposit(amount);
    }

    function depositInTags(uint256 amount) external override {
        require(
            tagToken.transferFrom(_msgSender(), address(this), amount),
            'Unable to pull funds from the sender'
        );

        uint256 result = _swap(tagToken, underlyingToken, amount, address(this));

        _deposit(result);
    }

    function harvestYieldInTags() external override onlyGameMaster {
        uint256 currentBalance = aaveAToken.balanceOf(address(this));
        require(currentBalance > principalBalance, 'Current pool balance is less than principal');

        // Withdraw yearned yield
        IAaveLendingPool lendingPool = aaveLendingPoolAddressesProvider.getLendingPool();
        uint256 yield = currentBalance.sub(principalBalance);
        uint256 withdrawn = lendingPool.withdraw(address(underlyingToken), yield, address(this));

        // Claim Aave rewards
        uint256 claimed = _claimRewards();
        withdrawn = withdrawn.add(claimed);

        // Convert to TAGs on Uniswap and send to the caller
        uint256 result = _swap(underlyingToken, tagToken, withdrawn, _msgSender());

        emit YieldHarvested(withdrawn, result);
    }

    function withdrawAll(address recipient) external onlyOwner {
        require(recipient != address(0), 'Invalid recipient');

        principalBalance = 0;
        IAaveLendingPool lendingPool = aaveLendingPoolAddressesProvider.getLendingPool();
        lendingPool.withdraw(address(underlyingToken), uint256(-1), recipient);
    }

    function setMinAmountToClaim(uint256 _minAmountToClaim) external onlyOwner {
        minAmountToClaim = _minAmountToClaim;
    }

    function setTagToken(IERC20 _tagToken) external onlyOwner {
        tagToken = _tagToken;
    }

    function _deposit(uint256 amount) internal returns (uint256) {
        principalBalance = principalBalance.add(amount);

        IAaveLendingPool lendingPool = aaveLendingPoolAddressesProvider.getLendingPool();
        require(underlyingToken.approve(address(lendingPool), amount), 'underlyingToken approve failed');
        lendingPool.deposit(address(underlyingToken), amount, address(this), 0);

        emit Deposit(_msgSender(), amount);
    }

    function _claimRewards() internal returns (uint256) {
        uint256 rewardsAmount = aaveIncentivesController.getUserUnclaimedRewards(address(this));
        if (rewardsAmount < minAmountToClaim) {
            return 0;
        }

        address[] memory pools = new address[](1);
        pools[0] = address(aaveAToken);
        uint256 claimed = aaveIncentivesController.claimRewards(pools, uint256(-1), address(this));

        IERC20 rewardToken = IERC20(aaveIncentivesController.REWARD_TOKEN());

        return _swap(rewardToken, underlyingToken, claimed, address(this));
    }

    function _swap(
        IERC20 from,
        IERC20 to,
        uint256 amount,
        address recipient
    ) internal returns (uint256) {
        require(from.approve(address(swapRouter), amount), 'underlyingToken approve failed');

        // TODO: fetch real minimum price instead of zero
        address[] memory path = new address[](2);
        path[0] = address(from);
        path[1] = address(to);
        uint256[] memory result = swapRouter.swapExactTokensForTokens(amount, 0, path, recipient, now);

        return result[1];
    }

    modifier onlyGameMaster() {
        require(hasRole(GAME_ADMIN, _msgSender()));
        _;
    }

    modifier onlyOwner() {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()));
        _;
    }
}
